import { lazy } from 'react'

export function LazyLoad(path, namedExport) {
    return lazy(() => {
        const promise = import(path);
        if (namedExport == null) {
            return promise
        } else {

            return promise.then(module => ({ default: module[namedExport] }));
        }
    })
}
LazyLoad("./Components/Pages/Main","Main")
